import React from "react";
import { Parallax, ParallaxLayer } from '@react-spring/parallax'

function Home(){
    return(
        <div style={{justifyContent:'center', alignItems:'center'}}>
            <Parallax pages={3}>
                <ParallaxLayer>
                    <h1>Motivation</h1>
                </ParallaxLayer>
                <ParallaxLayer offset={1}>
                    <h2>A Need in the Automotive Industry</h2>
                </ParallaxLayer>
            </Parallax>
        </div>
    );
}

export default Home;
